// SPDX-License-Identifier: MIT

// Ramanathan Nachiappan- 50469166
// Final - Property Registry and Transfer System Using NFT

// Individual project!

pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract PropertyRegistry  is ERC721 {
    address public chairperson;
    address payable pub;
    uint256 public tokenCounter;
    uint public totalAdmins;
    enum Type{HOUSE,LAND}
    enum PropertyStatus { UNVERIFIED, VERIFIED, AUCTION, TRANSFERRED } 
    enum reqStatus {requested,accepted,rejected,paymentdone,completed}
    uint requestCount = 0;

    struct Property {
        address payable Powner;
        address admin;
        uint propId;
        string name;
        string location;
        uint256 area;
        uint256 price;
        uint surveyNumber;
        PropertyStatus status;
        bool markAvailable;
        uint index;
        bool registered;
        uint noOfRequests;
        mapping(uint => RequestDetails) requests;

    }
    struct RequestDetails{
        address whoRequested;
        uint reqIndex;
    }
    struct UserProfile{
        address userAddr;
        string fullName;
        uint256 contact;
        uint totalIndices;
        uint requestIndices;
    }
    struct RequestedProp{
        uint surveyNumber;
        address payable sellerId;
        address payable buyerId;
        uint id;
        reqStatus requestStatus;
        uint amt;
        bool isPaymentDone;
    }
    struct Admin {
        address adminAddr;
    }
    struct OwnerOwns{
        uint surveyNumber;
    }
    mapping(address => mapping(uint => OwnerOwns)) public ownerMapsProperty;
    mapping(uint256 => Property) private properties;
    mapping(address => bool) private chairpersons;
    mapping(address => UserProfile) public userProfile;
    mapping(address => mapping(uint => RequestedProp)) public requestedProp;
    mapping (address => Admin) public admins;

    mapping(address => uint[])  MyProp;
    mapping(address => uint[])  MyReceivedRequest;
    mapping(address => uint[])  MySentRequest;
    mapping(uint => uint[])  allpropList;


    event PropertyRegistered(string name, string location, uint surveyNo, address owner, uint256 marketValue, uint256 size);
    event PropertySold(address indexed buyer, address indexed seller, uint256 indexed tokenId, uint256 price);
    event PropertyTransferred(address indexed from, address indexed to, uint256 indexed tokenId);

    constructor() ERC721("Property NFT", "PNFT"){
        chairperson = msg.sender;
        tokenCounter = 0;
    }
    modifier onlyAdmin(){
        require(admins[msg.sender].adminAddr == msg.sender, "Only admin can use this function");
        _;
    }
    modifier onlyOwner(uint256 _tokenCounter) {
        require(ownerOf(_tokenCounter) == msg.sender, "Only owner can call this function");
        _;
    }
    function addAdmin(address _adminAddr) external returns(bool){
        require(chairperson==msg.sender);
        Admin storage newAdmin = admins[_adminAddr];
        totalAdmins++;
        newAdmin.adminAddr = _adminAddr;
        return true;
    }
    function isAdmin() external view returns(bool){
        if(admins[msg.sender].adminAddr == msg.sender){
            return true;
        }
        else return false;
    }
    function addUser(string memory _fullName, uint256 _contact) external  {

        UserProfile storage newUserProfile = userProfile[msg.sender];
        newUserProfile.fullName = _fullName;
        newUserProfile.contact = _contact;
    }
    function registerProperty( string memory _name,string memory _location, uint _surveyNo,  address payable _owner, uint _marketValue, uint _sqft) external onlyAdmin{

        require(properties[_surveyNo].registered == false, "Survey Number already registered!");
        tokenCounter++;
        _safeMint(msg.sender, tokenCounter);
        Property storage newLandRegistry = properties[_surveyNo];
        OwnerOwns storage newOwnerOwns = ownerMapsProperty[_owner][userProfile[_owner].totalIndices];
        newLandRegistry.name = _name;
        newLandRegistry.location = _location;
        newLandRegistry.Powner = _owner;
        newLandRegistry.admin = msg.sender;
        newLandRegistry.propId = tokenCounter;
        newLandRegistry.surveyNumber = _surveyNo;
        newLandRegistry.index = userProfile[_owner].totalIndices;
        newLandRegistry.registered = true;
        newLandRegistry.price = _marketValue;
        newLandRegistry.markAvailable = false;
        newLandRegistry.status = PropertyStatus.VERIFIED;
        newLandRegistry.area = _sqft;
        newOwnerOwns.surveyNumber = _surveyNo;
        userProfile[_owner].totalIndices++;
        emit PropertyRegistered(_name, _location, _surveyNo, _owner, _marketValue, _sqft);
    }
    function transferProperty(uint256 _tokenCounter, address to) public onlyOwner(_tokenCounter) {
        require(ownerOf(_tokenCounter) == msg.sender, "Only the owner of the property can transfer ownership");
        require(properties[_tokenCounter].status != PropertyStatus.AUCTION, "Cannot transfer property during auction");
        require(properties[_tokenCounter].markAvailable != false, "Cannot transfer property when not in sale");
        _transfer(msg.sender, to, _tokenCounter);
        emit PropertyTransferred(msg.sender, to, _tokenCounter);

    }
    function putPropertyOnSale(uint256 _token) public  onlyOwner(_token){
         require(ownerOf(_token) == msg.sender, "Only the owner of the property can put it on sale");
         properties[_token].markAvailable = true;

    }function takePropertyOffSale(uint256 _token) public  onlyOwner(_token){
         require(ownerOf(_token) == msg.sender, "Only the owner of the property can take it off sale");
         properties[_token].markAvailable = false;
    }
    function myAllprop(address id) public view returns( uint[] memory){
        return MyProp[id];
    }
    function requestforBuy(uint _PropId, uint _surveyno, uint _amt) public
    {   
       pub= payable(msg.sender);
       requestCount++;
       requestedProp[msg.sender][requestCount]=RequestedProp(_surveyno,properties[_PropId].Powner,pub,_PropId,reqStatus.requested,_amt,false);
       MyReceivedRequest[properties[_PropId].Powner].push(requestCount);
       MySentRequest[msg.sender].push(requestCount);
    }
    function myReceivedLandRequests() public view returns(uint[] memory)
    {
        return MyReceivedRequest[msg.sender];
    }
    function mySentLandRequests() public view returns(uint[] memory)
    {
        return MySentRequest[msg.sender];
    }
    function acceptRequest(uint _requestId) public
    {
        require(requestedProp[msg.sender][_requestId].sellerId==msg.sender);
        requestedProp[msg.sender][_requestId].requestStatus=reqStatus.accepted;
    }
    function rejectRequest(uint _requestId) public
    {
       require(requestedProp[msg.sender][_requestId].sellerId==msg.sender);
        requestedProp[msg.sender][_requestId].requestStatus=reqStatus.rejected;
    }
    function requesteStatus(uint _requestId) public view returns(bool)
    {
        return requestedProp[msg.sender][_requestId].isPaymentDone;
    }
    function propPrice(uint _surveyNo) public view returns(uint)
    {
        return properties[_surveyNo].price;
    }
    function makePayment(uint _requestId) public payable
    {
        require(requestedProp[msg.sender][_requestId].buyerId==msg.sender && requestedProp[msg.sender][_requestId].requestStatus==reqStatus.accepted);

        requestedProp[msg.sender][_requestId].requestStatus=reqStatus.paymentdone;
        properties[requestedProp[msg.sender][_requestId].id].Powner.transfer(msg.value);
        requestedProp[msg.sender][_requestId].isPaymentDone=true;
        emit PropertySold(msg.sender, properties[requestedProp[msg.sender][_requestId].id].Powner, _requestId, msg.value);
    }
    function getPropDetails(uint _surveyNo) external view returns(address, uint256, uint, uint, uint,string memory){

        address owner = properties[_surveyNo].Powner;
        uint256 propertyid = properties[_surveyNo].propId;
        uint indx = properties[_surveyNo].index;
        uint sqft = properties[_surveyNo].area;
        uint mv = properties[_surveyNo].price;
        string memory location = properties[_surveyNo].location;
        return(owner, propertyid, indx, mv, sqft,location);     
    }
    function getUserProfile() external view returns(address,string memory, uint256){
        string memory fullName = userProfile[msg.sender].fullName;
        uint256 contact = userProfile[msg.sender].contact;
        return(msg.sender,fullName, contact);
    }
    function isAvailable( uint _surveyNo) external view returns(bool){
        bool available = properties[_surveyNo].markAvailable;
        return(available);
    }

    function getIndices() external view returns(uint, uint){
        uint _totalIndices = userProfile[msg.sender].totalIndices;
        uint _reqIndices = userProfile[msg.sender].requestIndices;
        return(_totalIndices, _reqIndices);
    }
    function getOwnerOwns() external view returns( uint){
        uint surveyNo = ownerMapsProperty[msg.sender][0].surveyNumber;
        return(surveyNo);
    }
    function markMyPropertyAvailable() external {
        uint surveyNumber = ownerMapsProperty[msg.sender][0].surveyNumber;
        require(properties[surveyNumber].markAvailable == false, "Property already marked available");
        properties[surveyNumber].markAvailable = true;

    }
    function didIRequested(uint _surveyNo) external view returns(bool){

        Property storage thisLandDetail = properties[_surveyNo];
        uint _noOfRequests = thisLandDetail.noOfRequests;

        if(_noOfRequests == 0) 
            return (false);

        for(uint i=0; i<_noOfRequests; i++){
            if(thisLandDetail.requests[i].whoRequested == msg.sender){
                return (true);
            }
        } 

        return(false);
    }
    function RequestForBuy(uint _surveyNo) external{

        Property storage thisLandDetail = properties[_surveyNo];
        require(thisLandDetail.markAvailable == true, "This property is NOT marked for sale!");

        uint req_serialNum = thisLandDetail.noOfRequests; 
        thisLandDetail.requests[req_serialNum].whoRequested = msg.sender;
        thisLandDetail.requests[req_serialNum].reqIndex = userProfile[msg.sender].requestIndices;
        thisLandDetail.noOfRequests++;

        RequestedProp storage newReqestedLands = requestedProp[msg.sender][userProfile[msg.sender].requestIndices];
        newReqestedLands.surveyNumber = _surveyNo;
        userProfile[msg.sender].requestIndices++;

    }
}
